import Home from './Home';
import Login from './Login';
//import Signup from './Signup';

import {Route} from 'react-router-dom';


function Main() {
  return (
    <div className="App">
      
  
        <Route path='/home' element={<Home />} ></Route>
        <Route path='/login' element={<Login />} ></Route>
      
      
    </div>
  );
}

export default Main;
